Help.addRelInfoCss = function() {
    for (var D in RI) {
        if (!RI.hasOwnProperty(D) || typeof(RI[D]) == "function" || D == "modified" || D == "deleted") {
            continue
        }
        if (RI[D] == "true") {
            Help.cssRules.push({
                selector: ".RIF_" + D + ":not(.RIV_true)",
                style: "display: none;"
            })
        } else {
            if (RI[D] == "false") {
                Help.cssRules.push({
                    selector: ".RIE_" + D,
                    style: "display: none;"
                });
                Help.cssRules.push({
                    selector: ".RIF_" + D + ":not(.RIV_false)",
                    style: "display: none;"
                })
            } else {
                var C = RI[D].replace(/\./g, "_");
                Help.cssRules.push({
                    selector: ".RIF_" + D + ":not(.RIV_" + C + ")",
                    style: "display: none;"
                });
                Help.cssRules.push({
                    selector: ".xRI_" + D + "_" + C,
                    style: "display: none;"
                })
            }
        }
    }
};
