FullDiskEncryptionAction.prototype.tabSelected = function(C) {
    if (C == null) {
        return
    }
    if (!this.tabWidget) {
        return
    }
    if (C == 0) {
        this.selectedTab = "general";
        this.setButtonText("cancel", strings.Cancel);
        this.setButtonText("ok", strings.set);
        this.tabWidget.update({
            tabDesc: {
                text: strings.fde.changePassphraseDescription
            },
            fdeConfigTable: {
                visibility: "visible"
            },
            importKeyTable: {
                visibility: "collapse"
            },
            repurposeDisksTable: {
                visibility: "collapse"
            }
        });
        this.resetSize({
            shrink: true
        })
    } else {
        if (C == 1) {
            this.selectedTab = "repurposeDisks";
            this.actionOkButton.setVisibility("visible");
            this.okEnabled(false);
            this.setButtonText("ok", strings.fde.Repurpose);
            this.setButtonText("cancel", strings.Cancel);
            this.tabWidget.update({
                tabDesc: {
                    text: strings.fde.repurposeDisksDescription
                },
                fdeConfigTable: {
                    visibility: "collapse"
                },
                importKeyTable: {
                    visibility: "collapse"
                },
                repurposeDisksTable: {
                    visibility: "visible"
                }
            });
            this.resetSize({
                shrink: true
            })
        } else {
            if (C == 2) {
                this.selectedTab = "importDisks";
                this.actionOkButton.setVisibility("visible");
                this.okEnabled(false);
                this.setButtonText("ok", strings.set);
                this.setButtonText("cancel", strings.Cancel);
                this.tabWidget.update({
                    tabDesc: {
                        text: strings.fde.importFDEDescription
                    },
                    fdeConfigTable: {
                        visibility: "collapse"
                    },
                    importKeyTable: {
                        visibility: "visible"
                    },
                    repurposeDisksTable: {
                        visibility: "collapse"
                    }
                });
                this.resetSize({
                    shrink: true
                })
            }
        }
    }
};

