RecoveryManager.prototype.okCallback = function() {
    switch (this.currentState) {
        case "failoverIntro":
            this.setFailoverSnapState();
            break;
        case "failoverSnap":
            this.createSnapshot();
            break;
        case "failoverAction":
            this.initiateFailover();
            break;
        case "failoverMap":
            this.mapVolume(false);
            break;
        case "recoveryIntro":
            this.setRecoverySnapState();
            break;
        case "recoverySnap":
            this.createSnapshot();
            break;
        case "recoveryOp":
            this.setRecoveryConfirmState();
            break;
        case "recoveryConfirm":
            this.initiateRecovery();
            break;
        case "restoreDirection":
            this.initiateRestore();
            break;
        case "restoreMap":
            this.mapVolume(false);
            break;
        default:
            break
    }
    this.resetSize({
        shrink: true
    });
    this.setBorder()
};
RecoveryManager.prototype.applyCallback = function() {
    switch (this.currentState) {
        case "failoverSnap":
            this.setfailoverActionState();
            break;
        case "failoverMap":
            this.didMap = false;
            this.setFailoverSummaryState();
            break;
        case "failoverAction":
            this.setFailoverMapState();
            break;
        case "recoverySnap":
            this.setRecoveryOperationState();
            break;
        case "restoreMap":
            this.didMap = false;
            this.setRestoreSummaryState();
            break;
        default:
            break
    }
    this.resetSize({
        shrink: true
    });
    this.setBorder()
};
