            this.bypassNotifications = decodeBooleanFlag(C.get("bypass_notifications_numeric"));
            this.bypassEasyStart = decodeBooleanFlag(C.get("bypass_easy_start_numeric"));
            NAV.navTo("topics", "home", null);
